import React from 'react';
import { Container, Row } from 'react-bootstrap';
import Navigation from '../Navigation/Navigation';

const layout = (props) => {
    return (
        <Container>
            
            <main>
                {props.children}
            </main>
            </Container>
    )
}

export default layout;
